import React from 'react'
import { Bar } from "react-chartjs-2";
function BarChart({ chartData }) {



    return (
        <div>BarChart

            <h2 style={{ textAlign: "center" }}>Bar Chart</h2>
            <Bar
                data={chartData}
                options={{
                    plugins: {
                        title: {
                            display: true,
                            text: "Users Gained between 2016-2020"
                        },
                        legend: {
                            display: false
                        }
                    }
                }}
            />

        </div>
    )
}

export default BarChart
